import React from 'react';
import './App.css';
import {useTransition} from './lib/useTransition.js'
function App() {
  const number = useTransition("#dd66ff", "#ffcc99", 3);
  return (
    <div className="App">
      <font color={number} size="20">Change Color</font>
    </div>
  );
}

export default App;
